import React, { ReactElement } from 'react';
import { Field } from "formik";
import './styles.scss';

interface IProps {
  type: 'text' | 'number';
  name: string;
}

function Input({ type, name }: IProps): ReactElement {
  return (
    <Field type={type} name={name} className='input' />
  );
}

export default Input;
